  return (
    <>
      <h1>{user.login}</h1>
      <Link href="home">
        <a>Go hard or go Home</a>
      </Link>
    </>
  );
}

About.getInitialProps = async () => {
  const response = await axios.get("https://api.github.com/users/italomarcos1");

  console.log(response.data);
  console.log("meeeeeeeeeeeeeeeeeh");

  return { user: response.data };
};

export default About;
